#-*- coding: utf-8 -*-
import logging
from ai_utils.phases.abstract_phase import AbstractPhaseClass
from ai_utils.utils.fileutils import FileUtilsClass as FileUtils
from tempfile import NamedTemporaryFile
import shutil, os, base64, subprocess

class GenerateMoveExePhaseClass(AbstractPhaseClass):
    TrackerId = '360'
    Subject = "Generate, move and execute binary"
    Description = "A binary is generated, moved to the destination directory and executed"
    encoded_binary = ''

    def __init__(self, isPhaseCritical, strFileName='notepad2.exe', strDestPath='C:\\Windows\\System32\\', strBinary=''):
        AbstractPhaseClass.__init__(self, isPhaseCritical)
        logging.info('Executing GenerateMoveExe phase...')
        assert (isinstance(strFileName, type('')) or isinstance(strFileName, type(u''))) and \
               strFileName.find('..') == -1 and strFileName.find('/') == -1 and strFileName.find('\\') == -1
        assert isinstance(strDestPath, type('')) or isinstance(strFileName, type(u''))
        assert isinstance(strBinary, type('')) or isinstance(strBinary, type(u''))
        self.strFileName = strFileName
        self.strDestPath = strDestPath
        self.strDestFileName = os.path.join(self.strDestPath, self.strFileName)
        namedTempFile = NamedTemporaryFile(delete=False)
        self.tmpBinaryPath = namedTempFile.name
        self.encodedBinary = strBinary if strBinary else self.encoded_binary

    def Setup(self):
        return FileUtils.DirExists(self.strDestPath) and not FileUtils.FileExists(self.strDestPath + self.strFileName)

    def _create_binary(self):
        self.PhaseReporter.Info('Creating binary file from in-memory data...')
        decoded = base64.b64decode(self.encodedBinary)
        with open(self.tmpBinaryPath, 'wb') as fd:
            fd.write(decoded)
        return FileUtils.FileExists(self.tmpBinaryPath) and FileUtils.GetFilesize(self.tmpBinaryPath) > 0

    def _move_binary(self):
        self.PhaseReporter.Info('Moving file from {0} to {1}'.format(self.tmpBinaryPath, self.strDestFileName))
        success = True
        try:
            shutil.move(self.tmpBinaryPath, self.strDestFileName)
        except Exception as e:
            success = False
            logging.error('File "{0}" could not be moved to "{1}" with name "{2}": {3}'.format(self.tmpBinaryPath, self.strDestPath, self.strFileName, e))
        return success

    def _execute_binary(self):
        self.PhaseReporter.Info('Executing binary...')
        success = False
        try:
            # We use wait() to stop script execution until executed binary finishes. This can be modified.
            subprocess.Popen([self.strDestFileName]).wait()
            success = True
        except Exception as e:
            logging.error('File "{0}" could not be executed": {1}'.format(self.strFileName, e))
        return success

    def ManualCleanup(self):
        fileToRemove = '{0}'.format(self.strDestFileName)
        success = FileUtils.DeleteFile(fileToRemove)
        if success:
            logging.info('File {0} was correctly removed.'.format(fileToRemove))
        else:
            self.PhaseReporter.Warn('Alternate stream could not be deleted: {0}'.format(fileToRemove))

        return success

    def Run(self):
        phaseSuccessful = self._create_binary()
        if phaseSuccessful:
            phaseSuccessful = self._move_binary()
            if phaseSuccessful:
                phaseSuccessful = self._execute_binary()
        if phaseSuccessful:
            self.PhaseReporter.Info('Successfully created({0}), moved({1}) and executed a binary'.format(self.strFileName, self.strDestPath))
        else:
            self.PhaseReporter.Info('Failed to create({0}), move({1}) and execute a binary'.format(self.strFileName, self.strDestPath))
        return phaseSuccessful
